<div class="schedule">
  <div class="heading">
    <div class="today">Today's Schedule</div>
    <div class="row active-group">
      <div class="col-xs-1">
        <span ng-click="$ctrl.previousGroup()" class="glyphicon glyphicon-chevron-left"></span>
      </div>
      <div ng-click="$ctrl.toggleExtra()" class="col-xs-10 text-center">
        {{$ctrl.activeGroup.name}}
      </div>
      <div class="col-xs-1">
        <span ng-click="$ctrl.nextGroup()" class="glyphicon glyphicon-chevron-right"></span>
      </div>
      <div class="extra-info text-center" ng-show="$ctrl.showExtraInfo">
        <div class="col-xs-4">{{$ctrl.activeGroupAges()}}</div>
        <div class="col-xs-4">{{$ctrl.activeGroupTotalKids()}}/{{$ctrl.activeGroupTotalAdults()}}</div>
        <div class="col-xs-4">{{$ctrl.activeGroupTimeSpan()}}</div>
      </div>
    </div>
  </div>
